import React, { useState } from 'react'


const Form = () => {
  const [enabled , setenabled] = useState(true)

    const toggle = ()=>{
      setenabled(true)
    }
    const change = (event)=>{
       if(event.target.value.length > 0){
         setenabled(false)
       }
       else{
         setenabled(true)
       }
    }
  return (
    <>
    <input type="text" onChange={change}/>
    {(event.target.value.length > 0)?<button disabled={enabled} onClick={toggle}>Click </button>:<h2>enter something</h2>}
    
    </>
  )
}

export default Form
